import React from 'react';
import style from './App.module.css';

console.log(style);

const App = () => {
  return (<>
    <main>
      <div className="container-fluid border border-danger style.mainContainer" id="mainContainer">
        <div className="row border border-warning">
          <div className="col-lg-4 col-md-3 d-md-block d-none border border-success">

          </div>
          <div className="col-lg-8 col-md-9 border border-blue"></div>
        </div>
      </div>
    </main>
  </>);
}

export default App;
